import React from 'react'
import style from '../../styles/test-modals-style/CompletedTest.module.css'

export const CompletedTest = ({questions}) => {
  const correctAnswer = localStorage.getItem("correctAnswer") || 0
  return (
    <div className={style.CompletedTestWrapper}>
        <div className={style.CompletedTestContainer}>
            <p>Тест завершено</p>
            <p>Ви набрали {correctAnswer} з {questions.lenght}</p>
        </div>
    </div>
  )
}
